import { useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";

// Fun mascot image (free to use, or swap with your own!)
const DOG_MASCOT =
  "https://cdn.pixabay.com/photo/2016/03/31/19/14/dog-1298135_1280.png";

const LAVENDER_GRADIENT =
  "linear-gradient(135deg, #f3e8ff 0%, #b983ff 50%, #a084ca 100%)";
const GLASS_BG =
  "rgba(255,255,255,0.45)";
const GLOW = "0 0 24px #b983ff66, 0 0 48px #a084ca33";

const Login = () => {
  const [data, setData] = useState({ email: "", password: "" });
  const [error, setError] = useState("");
  const handleChange = ({ currentTarget: input }) => {
    setData({ ...data, [input.name]: input.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const url = "http://localhost:8080/api/auth";
      const { data: res } = await axios.post(url, data);
      localStorage.setItem("token", res.data);
      window.location = "/";
    } catch (error) {
      if (
        error.response &&
        error.response.status >= 400 &&
        error.response.status <= 500
      ) {
        setError(error.response.data.message);
      }
    }
  };

  return (
    <div
      style={{
        minHeight: "100vh",
        background: LAVENDER_GRADIENT,
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        overflow: "hidden",
        position: "relative"
      }}
    >
      {/* Animated floating bubbles */}
      {[...Array(6)].map((_, i) => (
        <div
          key={i}
          style={{
            position: "absolute",
            top: `${10 + i * 12}%`,
            left: `${i % 2 === 0 ? 5 : 85}%`,
            width: `${60 + i * 10}px`,
            height: `${60 + i * 10}px`,
            background: "rgba(185,131,255,0.12)",
            borderRadius: "50%",
            filter: "blur(2px)",
            animation: `float${i} 8s ease-in-out infinite`,
            zIndex: 1
          }}
        />
      ))}
      <style>
        {`
        @keyframes float0 { 0%{transform:translateY(0);} 50%{transform:translateY(-30px);} 100%{transform:translateY(0);} }
        @keyframes float1 { 0%{transform:translateY(0);} 50%{transform:translateY(20px);} 100%{transform:translateY(0);} }
        @keyframes float2 { 0%{transform:translateY(0);} 50%{transform:translateY(-20px);} 100%{transform:translateY(0);} }
        @keyframes float3 { 0%{transform:translateY(0);} 50%{transform:translateY(30px);} 100%{transform:translateY(0);} }
        @keyframes float4 { 0%{transform:translateY(0);} 50%{transform:translateY(-25px);} 100%{transform:translateY(0);} }
        @keyframes float5 { 0%{transform:translateY(0);} 50%{transform:translateY(15px);} 100%{transform:translateY(0);} }
        `}
      </style>

      <div
        className="card shadow-lg p-0 border-0"
        style={{
          maxWidth: 900,
          width: "100%",
          display: "flex",
          flexDirection: "row",
          borderRadius: 32,
          background: GLASS_BG,
          backdropFilter: "blur(16px)",
          boxShadow: GLOW,
          zIndex: 2
        }}
      >
        {/* Left: Mascot + Welcome */}
        <div
          className="d-none d-md-flex flex-column align-items-center justify-content-center p-5"
          style={{
            background: "rgba(185,131,255,0.18)",
            borderTopLeftRadius: 32,
            borderBottomLeftRadius: 32,
            minWidth: 320,
          }}
        >
          <img
            src={DOG_MASCOT}
            alt="Dog Mascot"
            style={{
              width: 120,
              height: 120,
              objectFit: "contain",
              filter: "drop-shadow(0 0 16px #b983ff99)"
            }}
          />
          <h2 className="mt-4 mb-2 fw-bold" style={{ color: "#7f53ac" }}>
            Witaj w PuppyParadise!
          </h2>
          <p className="text-muted text-center" style={{ fontSize: 18 }}>
            Najlepszy salon dla Twojego pupila.<br />
            Zaloguj się i zadbaj o swojego psa!
          </p>
        </div>
        {/* Right: Login form */}
        <div
          className="flex-fill p-5"
          style={{
            minWidth: 320,
            borderTopRightRadius: 32,
            borderBottomRightRadius: 32,
            background: "rgba(255,255,255,0.75)"
          }}
        >
          <form onSubmit={handleSubmit}>
            <h1 className="mb-4 fw-bold text-center" style={{ color: "#a084ca", letterSpacing: 1 }}>
              Logowanie
            </h1>
            <input
              type="email"
              placeholder="Email"
              name="email"
              onChange={handleChange}
              value={data.email}
              required
              className="form-control mb-3 py-3"
              style={{
                borderColor: "#b983ff",
                background: "#f3e8ff",
                fontSize: 18,
                borderRadius: 16
              }}
            />
            <input
              type="password"
              placeholder="Hasło"
              name="password"
              onChange={handleChange}
              value={data.password}
              required
              className="form-control mb-3 py-3"
              style={{
                borderColor: "#b983ff",
                background: "#f3e8ff",
                fontSize: 18,
                borderRadius: 16
              }}
            />
            {error && (
              <div
                className="alert alert-danger py-2"
                style={{
                  background: "#f3e8ff",
                  color: "#a084ca",
                  borderColor: "#b983ff",
                  borderRadius: 12
                }}
              >
                {error}
              </div>
            )}
            <button
              type="submit"
              className="btn w-100 mb-2 py-3 fw-bold"
              style={{
                background: "linear-gradient(90deg, #b983ff 0%, #a084ca 100%)",
                color: "#fff",
                fontSize: 20,
                border: "none",
                borderRadius: 16,
                boxShadow: GLOW,
                transition: "transform 0.2s, box-shadow 0.2s"
              }}
              onMouseOver={e => {
                e.currentTarget.style.transform = "scale(1.04)";
                e.currentTarget.style.boxShadow = "0 0 32px #a084ca99";
              }}
              onMouseOut={e => {
                e.currentTarget.style.transform = "scale(1)";
                e.currentTarget.style.boxShadow = GLOW;
              }}
            >
              Zaloguj się
            </button>
          </form>
          <div className="text-center mt-4">
            <span style={{ color: "#a084ca", fontWeight: 500 }}>Nie masz konta?</span>
            <Link to="/signup" className="ms-2">
              <button
                type="button"
                className="btn"
                style={{
                  background: "#fff",
                  color: "#a084ca",
                  border: "2px solid #b983ff",
                  fontWeight: "bold",
                  borderRadius: 16,
                  boxShadow: "0 0 8px #b983ff22",
                  transition: "background 0.2s, color 0.2s"
                }}
                onMouseOver={e => {
                  e.currentTarget.style.background = "#a084ca";
                  e.currentTarget.style.color = "#fff";
                }}
                onMouseOut={e => {
                  e.currentTarget.style.background = "#fff";
                  e.currentTarget.style.color = "#a084ca";
                }}
              >
                Zarejestruj się
              </button>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
